INSERT INTO r_step_type (id_step_type, code, description, helptext) VALUES (1, 'Abort', 'Abort', 'Abort a transformation');
INSERT INTO r_step_type (id_step_type, code, description, helptext) VALUES (2, 'CheckSum', 'Add a checksum', 'Add a checksum column for each input row');
INSERT INTO r_step_type (id_step_type, code, description, helptext) VALUES (3, 'Constant', 'Add constants', 'Add one or more constants to the input rows');
INSERT INTO r_step_type (id_step_type, code, description, helptext) VALUES (4, 'Sequence', 'Add sequence', 'Get the next value from an sequence');
INSERT INTO r_step_type (id_step_type, code, description, helptext) VALUES (5, 'FieldsChangeSequence', 'Add value fields changing sequence', 'Add sequence depending of fields value change.
INSERT INTO r_step_type (id_step_type, code, description, helptext) VALUES (6, 'AddXML', 'Add XML', 'Encode several fields into an XML fragment');
INSERT INTO r_step_type (id_step_type, code, description, helptext) VALUES (7, 'AggregateRows', 'Aggregate Rows', 'This step type allows you to aggregate rows.
INSERT INTO r_step_type (id_step_type, code, description, helptext) VALUES (8, 'AnalyticQuery', 'Analytic Query', 'Execute analytic queries over a sorted dataset (LEAD/LAG/FIRST/LAST)');
INSERT INTO r_step_type (id_step_type, code, description, helptext) VALUES (9, 'Append', 'Append streams', 'Append 2 streams in an ordered way');
INSERT INTO r_step_type (id_step_type, code, description, helptext) VALUES (10, 'AutoDoc', 'Automatic Documentation Output', 'This step automatically generates documentation based on input in the form of a list of transformations and jobs');
INSERT INTO r_step_type (id_step_type, code, description, helptext) VALUES (11, 'AvroInput', 'Avro Input', 'Reads data from an Avro file');
INSERT INTO r_step_type (id_step_type, code, description, helptext) VALUES (12, 'BlockUntilStepsFinish', 'Block this step until steps finish', 'Block this step until selected steps finish.');
INSERT INTO r_step_type (id_step_type, code, description, helptext) VALUES (13, 'BlockingStep', 'Blocking Step', 'This step blocks until all incoming rows have been processed.  Subsequent steps only recieve the last input row to this step.');
INSERT INTO r_step_type (id_step_type, code, description, helptext) VALUES (14, 'Calculator', 'Calculator', 'Create new fields by performing simple calculations');
INSERT INTO r_step_type (id_step_type, code, description, helptext) VALUES (15, 'DBProc', 'Call DB Procedure', 'Get back information by calling a database procedure.');
